import React from "react";
import "./styles.scss";
import useStyles from "./styles";
import { Box, Grid, Typography } from "@material-ui/core";

export default function Home() {
  const classes = useStyles();
  return (
    <Box className="home-admin mt-5">
      <Grid container className="list-top px-3" spacing={1}>
        <Grid item xs className="">
          <Box className={classes.item}>
            <Typography
              className={classes.floatRight}
              variant="body1"
              sx={{ textAlign: "right" }}
              color="#999"
            >
              Used Space
            </Typography>
            <Typography
              className={classes.floatRight}
              variant="body1"
              sx={{ textAlign: "right" }}
              color="#333"
            >
              49/50 GB
            </Typography>
          </Box>
        </Grid>
        <Grid item xs>
          <Box className={classes.item}></Box>
        </Grid>
        <Grid item xs>
          <Box className={classes.item}></Box>
        </Grid>
        <Grid item xs>
          <Box className={classes.item}></Box>
        </Grid>
      </Grid>
    </Box>
  );
}
